properties.css:
body {
    background-color: #ffffff;
    color: #000000;
}

body,
button,
.label {
    font-family: "Segoe UI", Frutiger, "Frutiger Linotype", "Helvetica Neue", Arial, sans-serif!important;
}

#content {
    background-color: #ffffff;
}

#form-canvas {
    background-color: #ffffff!important;
}

.btn {
    color: #ffffff;
    background-color: #899bc1;
    border-color: #899bc1;
}

.form-section-title span,
.subform-section-title span {
    background-color: #7bd5e5!important;
    color: #ffffff;
    border-bottom: 1px solid #7bd5e5!important;
    text-shadow: none!important;
}

.nav-tabs.nav-stacked > li > a:focus,
.nav-tabs.nav-stacked > li > a:hover,
.nav-tabs.nav-stacked > li > ul > li > a:focus,
.nav-tabs.nav-stacked > li > ul > li > a:hover,
.navbar .nav > li > a,
.navbar,
.navbar-inner,
a.brand span {
    background-color: #2a9baf!important;
    color: #ffffff!important;
}

#sidebar {
    background-color: #3fb2c6;
}

a.dropdown .fa,
.nav-tabs.nav-stacked > li > a,
.nav-tabs.nav-stacked > li > ul > li > a {
    color: #ffffff;
}

.sidebar-nav > ul > li > ul {
    background-color: #3fb2c6;
}

.current-category > a,
.nav-tabs.nav-stacked > li > a:focus,
.nav-tabs.nav-stacked > li > a:hover,
.nav-tabs.nav-stacked > li > ul > li > a:focus,
.nav-tabs.nav-stacked > li > ul > li > a:hover,
.nav-tabs.nav-stacked > li.active.current-category > a,
.nav-tabs.nav-stacked > li.current-category > a {
    color: #ffffff!important;
    background-color: #4acae2!important;
}

.nav-tabs.nav-stacked > li.active > a,
.nav-tabs.nav-stacked > li > ul > li.active > a {
    color: #ffffff!important;
    background-color: #62d9ef!important;
}

.btn-primary,
.btn-primary.disabled:active,
.btn-primary.disabled:focus,
.btn-primary.disabled:hover,
.btn-primary[disabled]:active,
.btn-primary[disabled]:focus,
.btn-primary[disabled]:hover,
body .dataList td a,
body input.btn[type="submit"],
fieldset[disabled] .btn-primary:active,
fieldset[disabled] .btn-primary:focus,
fieldset[disabled] .btn-primary:hover {
    color: #ffffff!important;
    background-color: #4ca64c!important;
    border-color: #4ca64c!important;
}

.btn:hover,
body input.btn[type="submit"]:hover {
    background-color: #3f34a5!important;
    border-color: #3f34a5!important;
}

footer {
    color: #d8d8d8!important;
    background-color: #3fb2c6!important;
}
